    background: #3E92CC;
}

.jumbotron {
    width: 100%;
    height: 600px;
    padding: 0;
    margin: 0;
}

.separator {
    color: #FFFAFF;
    height: 500px;
    margin: 0;
    padding: 0;
    display: flex;
