    width: 100%;
    height: 300px;
    background: #FFFAFF;
    display: flex;
    justify-content: space-between;
}

.panel {
    padding: 10px;
    width: 30%;
    display: flex;
    align-items: center;
    justify-content: center;
}

.panel ul {
    list-style: none;
